import React, { Component } from "react";
class Login extends Component {
  state = {};

  render() {
    return (
      <div style={style}>
        <input placeholder="what's your name"></input>
        <button>
          <Link to="/game">click me to play</Link>
        </button>
      </div>
    );
  }
}
const style = {
  display: "flex",
  justifyContent: "center",
};
export default Login;
